const canvas= document.getElementById('canvas1');
const  ctx = canvas.getContext('2d');

const image1 = new Image(); //creates hidden img html element

//wth is cors? cross  origin resource sharing
image1.src = 'data:image/png;base64,';
const inputSlider = document.getElementById('resolution');

const inputLabel = document.getElementById('resolutionLabel');
inputSlider.addEventListener('change', handleSlider);

class Cell{
    constructor(x, y, symbol , color){
        this.x=x;
        this.y= y;
        this.symbol= symbol;
        this.color = color;
    }
    draw(ctx){
        ctx.fillStyle =  'white'; //shadows
        ctx.fillText(this.symbol, this.x+0.5, this.y+0.5); //here 0.5 is the offset
        ctx.fillStyle =  this.color; //drawn on top of the shadow
        ctx.fillText(this.symbol, this.x, this.y);


    }
}

class AsciiEffect{
//giving it properties, fields
 //privacy encapsulation of class features willbe enforced by js
    #imageCellArray =[]; //array that holds all the cell objects that  make up the grid

    // #symbols =[];// symbols that represent pixels
    #pixels= []; //stores pixel data returned by get image data method
    #ctx;
    #width;
    #height;
    constructor(ctx, width, height){
        this.#ctx = ctx;
        this.#width= width;
        this.#height = height;
        this.#ctx.drawImage(image1, 0, 0 , this.#width, this.#height);
        this.#pixels = this.#ctx.getImageData(0, 0 , this.#width, this.#height);
        console.log(this.#pixels.data);

    }
#convertToSymbol(g){
    if ( g > 250) return '@'; //lighter or whiter pixel areas will now have @ sign
    else if ( g> 240) return '*';
    else if ( g> 220) return '+';
    else if ( g> 200) return '#';
    else if ( g> 180) return '&';
    else if ( g> 160) return '%';
    else if ( g> 140) return '_';
    else if ( g> 120) return ':';
    else if ( g> 100) return '$';
    else if ( g> 80) return '/';
    else if ( g> 60) return '-';
    else if ( g> 40) return 'X';
    else if ( g> 20) return 'W';

    else return '';
}
#scanImage(cellSize){
    this.#imageCellArray=[];
    //slicing the canvas into grid using for loops
    //x and y gives us the co-ordiantes of the cell
    for(let y=0; y < this.#pixels.height; y+=cellSize){
        for(let x=0; x < this.#pixels.width; x+=cellSize){
            
            //scanning the pixel color , average it out, convert each cell into a symbol based ont he original color
            const posX = x*4;   //red
            const posY = y*4;
            const pos = (posY * this.#pixels.width )+ posX;  // taking into account  all rows that we had cycled over  + current x pos 
            
            if (this.#pixels.data[pos +  3]>128){  //checking alpha value..if it is above 128 then it is transparent
                    const red= this.#pixels.data[pos];
                    const green = this.#pixels.data[pos+1];
                    const blue =this.#pixels.data[pos+2];
                    const total =red+green+ blue;
                    const averageColorValue = total/3;
                    const color = "rgb("+ red+","+ green +","+blue+")";
                    const symbol = this.#convertToSymbol(averageColorValue);
                    if (total >200){ 
                        //only create new cell if the total > 200 ..this will exclude the darkest areas, dim areas
                        this.#imageCellArray.push(new Cell(x, y, symbol, color));
                    }
                    

            }
        }
    }
    console.log(this.#imageCellArray);
}

#drawAscii(){
    this.#ctx.clearRect(0, 0, this.#width, this.#height);  //clearing old paint
    for (let i = 0; i<this.#imageCellArray.length; i++){
        this.#imageCellArray[i].draw(this.#ctx);   //context to know which canvas we want to draw on 
    }

}

draw(cellSize){  //public method
    this.#scanImage(cellSize);
    this.#drawAscii();
}
 
}

let effect;
function handleSlider(){
    if (inputSlider.value ==1){
        inputLabel.innerHTML ='Original Image';
        ctx.drawImage(image1 ,0 , 0, canvas.width, canvas.height);
    }
    else{

        inputLabel.innerHTML = 'Resolution '+inputSlider.value+'px';
        ctx.font=parseInt(inputSlider.value)*1.2 + "px Verdana"; // scaling the font of symbol with cell size
        effect.draw(parseInt(inputSlider.value));
       
    }
}
image1.onload = function initialize(){
    //for displaying on canvas
    canvas.width = image1.width;
    canvas.height = image1.height;
    effect =new AsciiEffect(ctx, image1.width, image1.height);
    // effect.draw(1);
    handleSlider();
    
}